  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">
    <h1><inlineCode parentName="h1">{`tinacms-contentful`}</inlineCode></h1>
    <p>{`A series of libraries aimed to make using TinaCMS with Contentful easy.`}</p>
    <h2>{`Find what you're looking for`}</h2>
    <p>{`Looking to learn how the library works?`}</p>
    <ul>
      <li parentName="ul">
        <p parentName="li">{`Follow the `}<a parentName="p" {...{
            "href": "./getting-started"
          }}>{`Getting Started Guide`}</a>{` to install and get set up`}</p>
      </li>
