              "className": "footnote-ref"
            }}>{`1`}</a></sup>{`:`}</p>
        <ul parentName="li">
          <li parentName="ul"><a parentName="li" {...{
              "href": "./docs/react-tinacms-contentful/index.html"
            }}><inlineCode parentName="a">{`react-tinacms-contentful`}</inlineCode></a></li>
          <li parentName="ul"><a parentName="li" {...{
              "href": "./docs/tinacms-contentful/index.html"
            }}><inlineCode parentName="a">{`tinacms-contentful`}</inlineCode></a></li>
        </ul>
      </li>
      <li parentName="ul">
        <p parentName="li">{`Check out one of the following demos:`}</p>
        <ul parentName="li">
          <li parentName="ul"><a parentName="li" {...{
              "href": "./demos/editing"
